import axios from 'axios';

const Deconnexion = () => {
    const deco = async (req, res) => {

        try {
            const mamono = await axios.get('http://localhost:8000/logout').then((response) => {
                console.log(response.data);
            });
        } catch (error) {
            console.log(error);
        }
    };

    return <div></div>;
};

export default Deconnexion;

// Exposer la fonction `deco` comme une méthode statique
Deconnexion.deco = async () => {

    try {
        await axios.get('http://localhost:8000/logout').then((response) => {

            window.location.href = './login';
        });
    } catch (error) {
        console.log(error);
    }
};
